/**
 * 递归遍历树形结构
 * @param {Object} node - 当前要遍历的节点
 * @param {number} level - 当前节点的层级，用于控制缩进，使输出更清晰
 */
function traverseTree(node:any, level = 0) {
  // 1. 处理当前节点：打印其信息
  // 使用 level * 2 个空格进行缩进，以可视化地展示树的层级
  const indent = '  '.repeat(level);

  node.link = node.url
  node.text = node.title
  node.items = node.children
  node.collapsed = !node.selected || false
  // 2. 递归处理子节点
  // 检查当前节点是否有 'items' 属性，并且 'items' 是一个非空数组
  if (node.items && Array.isArray(node.items) && node.items.length > 0) {
    // 遍历 'items' 数组中的每一个子节点
    node.items.forEach(childNode => {
      // 递归调用自身，并将层级 level + 1
      traverseTree(childNode, level + 1);
    });
  }
}
